{
"application": "accelerate",
"details": {
"environment": {
"conda_env": "eval-harness",
"slurm_env": {
"nodes": 1,
"tasks_per_node": 1,
"cpus_per_task": 48,
"gpus_per_node": 4,
"partition": "production-cluster",
"output": "/fsx/loubna/logs/evaluation/mpe-1b/%x-%j.out"
},
"gpu_config": {
"GPUS_PER_NODE": 4,
"MASTER_ADDR": "scontrol show hostnames $SLURM_JOB_NODELIST | head -n 1",
"MASTER_PORT": 6000,
"NNODES": "$SLURM_NNODES",
"NODE_RANK": "$SLURM_PROCID",
"WORLD_SIZE": "$GPUS_PER_NODE*$NNODES"
},
"training_config": {
"model": "$1",
"lang": "$2",
"CMD": "/fsx/loubna/code/bigcode-evaluation-harness/main.py --model bigcode/$model --tasks multiple-$lang --max_length_generation 512 --batch_size 50 --n_samples 50 --temperature 0.2 --precision bf16 --allow_code_execution --trust_remote_code --save_generations --use_auth_token --generation_only --save_generations_path $OUT_PATH/$model-$lang.json",
"LAUNCHER": "accelerate launch --multi_gpu --num_machines $NNODES --num_processes $WORLD_SIZE --main_process_ip \"$MASTER_ADDR\" --main_process_port $MASTER_PORT --num_processes $WORLD_SIZE --machine_rank $SLURM_PROCID --role $SLURMD_NODENAME: --rdzv_conf rdzv_backend=c10d --max_restarts 0 --tee 3",
"SRUN_ARGS": "--wait=60 --kill-on-bad-exit=1"
},
"network_config": {
"NCCL_ASYNC_ERROR_HANDLING": 1,
"NCCL_PROTO": "simple",
"RDMAV_FORK_SAFE": 1,
"FI_EFA_FORK_SAFE": 1,
"FI_EFA_USE_DEVICE_RDMA": 1,
"FI_PROVIDER": "efa",
"FI_LOG_LEVEL": 1,
"NCCL_IB_DISABLE": 1,
"NCCL_SOCKET_IFNAME": "ens"
},
"resources": {
"code_base": "/fsx/loubna/code/bigcode-evaluation-harness",
"output_path": "/fsx/loubna/logs/evaluation/mpe-1b",
"model_path": "/fsx/loubna/code/bigcode-evaluation-harness/replit-code-v1-3b",
"generations_path": "/app/java_starcoder-3b.json",
"generations_save_path": "/fsx/loubna/code/bigcode-evaluation-harness/multiple_gens"
},
"other": {
"environment_source": "/admin/home/loubna/.bashrc",
"tasks": [
"multiple-java"
],
"model_type": "bigcode"
}
}
}
